import React, { useEffect } from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { getUsers } from "../store/slice/userReducer"

function Loan() {

    const {users} = useSelector(state => state.userReducer);
    const dispatch = useDispatch();

    useEffect(()=>{
        dispatch(getUsers())
    }, [])


    return (
        <div>
            {
                users.map((user, index)=> <div key={user.id}>{user.firstName}</div>)
            }
        </div>
    );
}

export default Loan;
